import React from "react";
import Grid from "@mui/joy/Grid";
import Typography from "@mui/material/Typography";
import PersonIcon from "@mui/icons-material/Person";

export default function Spese() {
  return (
    <Grid
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "rgb(20, 42, 58)",
      }}
    >
      <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        style={{
          height: "90%",
          width: "80%",
          //backgroundColor: "rgb(203, 231, 253)",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="flex-start"
          alignItems="center"
          style={{
            height: "10%",
            width: "100%",
            //backgroundColor: "rgb(94, 175, 70)",
          }}
        >
          <Typography
            variant="h4"
            style={{ color: "#fcfcfc" }}
            sx={{ fontWeight: "bold" }}
          >
            Spese page
          </Typography>
        </Grid>
        <Grid
          container
          direction="column"
          style={{
            borderRadius: "5%",
            height: "90%",
            width: "100%",
            backgroundColor: "rgb(203, 231, 253)",
          }}
        >
          <Grid
            container
            direction="column"
            justifyContent="center"
            style={{
              height: "70%",
              width: "100%",
              backgroundColor: "rgb(93, 131, 53)",
            }}
          ></Grid>
          <Grid
            container
            direction="column"
            justifyContent="flex-start"
            alignItems="flex-start"
            style={{
              height: "30%",
              width: "100%",
              //backgroundColor: "rgb(193, 31, 153)",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="center"
              alignItems="center"
              style={{ width: "100%", height: "10%" }}
            >
              <Typography sx={{ fontWeight: "bold" }}>SPESE</Typography>
            </Grid>

            <Grid
              container
              directio="column"
              style={{
                height: "80%",
                width: "100%",
                backgroundColor: "rgb(193, 31, 153)",
                overflow: "auto",
              }}
            >
              <Grid
                container
                direction="column"
                justifyContent="flex-start"
                alignItems="center"
                style={{
                  marginTop: "2%",
                  height: "70%",
                  width: "20%",
                  marginLeft: "2%",
                  backgroundColor: "rgb(143, 211, 113)",
                }}
              >
                <Grid
                  container
                  justifyContent="center"
                  alignItems="center"
                  style={{
                    height: "100%",
                    width: "40%",
                    backgroundColor: "rgb(143, 211, 63)",
                  }}
                >
                  <PersonIcon
                    sx={{
                      height: "70%",
                      width: "100%",
                      //backgroundColor: "rgb(143, 11, 113)",
                    }}
                  />
                </Grid>
                <Grid
                  container
                  direction="column"
                  justifyContent="center"
                  alignItems="center"
                  style={{
                    height: "100%",
                    width: "60%",
                    backgroundColor: "rgb(143, 211, 113)",
                  }}
                >
                  <Typography sx={{ fontWeight: "bold" }}>
                    inquilino1
                  </Typography>
                  <Typography>-100</Typography>
                </Grid>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
}
